    "haz-map",nt"isopen": false,nt"url": null,nt"notes": "<p>Haz-Map
    is an occupational health database designed for health and safety professionals
    and for consumers seeking information about the adverse effects of workplace exposures
    to chemical and biological agents. The main links in Haz-Map are between chemicals
    and occupational diseases. These links have been established using current scientific
    evidence. The information in Haz-Map comes from textbooks, journal articles, the
    Documentation of the Threshold Limit Values (published by ACGIH), and electronic
    databases such as NLM Hazardous Substances Data Bank (HSDBu00ae). Haz-Map staff
    classifies, summarizes, and regularly updates the information found in the database.</p>n",nt"license_title":
